import "./Profile.css";

const Profile = ({name = "John Doe", age = "??", country = "Japan" }) => {
  return (
    <div className="profile">
      <>
      <p className="profile">{`Name: ${name}`}</p>
      <p>{`Age: ${age}`}</p>
      <p>{`From:${country}`}</p>
      </>
    </div>
  );
};


export default Profile;
